import React from "react";
import "./styles.css";
import weatherData from "./weatherData";

export default function App() {
  return (
    <div className="App">
      <h1>My WeatherIcons App</h1>
      {weatherData.map((chicken) => (
        <WeatherIcons
          img={chicken.img}
          conditions={chicken.conditions}
          time={chicken.time}
        ></WeatherIcons>
      ))}
    </div>
  );
}
